import React, { useEffect } from "react";
import { useRouter } from "next/router";
import { base } from "../../utils/airtableUtils";

export default function UserTeam() {
  const {
    query: { userId },
  } = useRouter();

  useEffect(() => {
    if (userId) {
      base("Draft Selections")
        .select({
          view: "Grid view",
        })
        .eachPage(
          function page(records) {
            // if (records.length === 0) {
            //   Router.push("/draftBoard");
            // }
            records.forEach(function ({ fields }) {
              if (fields.userId === userId) {
                console.log("fields", fields);
                return;
              }
            });
          },
          function done(err) {
            if (err) {
              console.error(err);
              return;
            }
          }
        );
    }
  }, [userId]);
  return (
    <div>
      <h1>User Team</h1>
    </div>
  );
}
